    return (
        <Dialog open fullWidth maxWidth='xs'>
            <Stack>
                <Stack direction='row'>
                    <Typography variant='h5'>Create Board</Typography>
                    <IconButton size='small'>
                        {/* <CloseIcon/> */}
                        X
                    </IconButton>
                </Stack>
            </Stack>
        </Dialog>
    )
}

export default CreateBoardModal
